import React from 'react';
import { button } from "react-bootstrap";
import { faCommentDots, faConciergeBell, faInfoCircle } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
class DashMenu extends React.Component{
    render(){
        return(
            <div className="dashmenu-wrapper">
<button > <FontAwesomeIcon icon={faConciergeBell}/> Menu</button>
<button ><FontAwesomeIcon icon={faCommentDots} /> Reviews()</button>
<button > <FontAwesomeIcon icon={faInfoCircle}/> Restaurant Info</button>

            </div>
        )
    }
}

export default DashMenu
